import React from 'react';

type Props = {};

export const Setting = (props: Props) => {
  return <div className='flex flex-col mt-5'>

      <section className='flex flex-col '>
        <h1>Change Password</h1>

        <input className='bg-gray-200 max-w-sm px-3 py-3 rounded-md focus:outline-none  mt-5' type="password" placeholder='current password'/>
        <input className='bg-gray-200 max-w-sm px-3 py-3 rounded-md focus:outline-none  mt-5' type="password" placeholder='new password'/>
        <input className='bg-gray-200 max-w-sm px-3 py-3 rounded-md focus:outline-none  mt-5' type="password" placeholder='old password'/>
      </section>

  </div>;
};
